import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link,useNavigate } from "react-router-dom";
import Nav from "./Nav";

const View = () => {
  const [id, setId] = useState(0);
  const [criminal_category_id, set1] = useState("");
